import React from 'react'
import Feed from '../Feed/Feed'
import SideBar from '../SideBar/SideBar'
import "./profile.scss"
import { useState, useEffect} from "react";
import axios from "axios";
import Share from '../Share/Share';


function Profile() {
  const [user, setUser] = useState({});

 
  
  useEffect(() => {
    const fetchUser = async () =>{
      const res = await axios.get(`/users?username=Lala`);
        setUser(res.data);
    }
     
    fetchUser();

}, [])


  return (
    <div className='profile'>
      <div className="body">
      <SideBar />
      <div className="profileContainer">

        <div className="profile_Name_Card">
            <img
                  className="profileProfileImg"
                  src={user.profilePicture || "/assets/images/person/noAvatar.png"}
                  alt=""
                />

              <div className="profile_info">
                <h2>{user.username}</h2>
                <h4>{user.desc}</h4>

              </div>
              <div className="profile_banner">
                <div className="profile_share">
                  <Share />
                </div>

                <div className="profile_top_info">
                  <h2>User Information:</h2>
                  <h3>City: {user.city}</h3>
                  <h4>{user._Id}</h4>
                  <h4>{user.email}</h4>
                </div>
              </div>


        </div>

        <div className="profile_bottom">
          
          <Feed/>

        </div>

      </div>

      </div>

      

    </div>
  )
}

export default Profile
